import React from "react";
import { BsFillHandThumbsUpFill } from "react-icons/bs";
const ThumbUp = (props) => {
  const clickLike = () => {
    setLike((like) => like + 1);
  };
  return (
    <div>
      <BsFillHandThumbsUpFill onClick={props.clickLike} className="thumb" />
      <span>{like}</span>
    </div>
  );
};
export default ThumbUp;
